const thirdParagraph = document.getElementsByClassName("desc")[0];

const button = document.querySelector("button");

console.log(thirdParagraph.classList);

button.addEventListener("click", () => {
  if (thirdParagraph.classList.contains("success")) {
    thirdParagraph.classList.remove("success");

    thirdParagraph.classList.add("error");
  } else {
    thirdParagraph.classList.remove("error");

    thirdParagraph.classList.add("success");
  }
});

